(15, 15, '', '', 'In all pages, after new entry addition or modifying the existing entry, auto-refresh does not happen.', '', '', 'High', 'All', 'sajja', '', '2010-05-02', '', '', 'Closed', '', '', '0000-00-00', '', 'Closed', 'sajja', '2010-07-03', '', '', '', 'User can click on the new entry and after key-in fields press F2 to save record. The new entry is then displaed in the list, here we can find that after each entry user will ne in new entry mode only.this is to avoid clicking new after each entry.\nIn modify mode after user modify records the the modify data is displayed in the list.', 1, '', '', '', ''),
(16, 16, '', '', 'When there is an entry with class name as "X", if search is done with X, below error is thrown. Browser - FireFox - 3.5.3\n\nYou have an error in your SQL syntax; check the manual that corresponds to your MySQL server version for the right syntax to use near \'-30,15\' at line 8\nE-Point 5546: SELECT s_section_details.ID,s_section_details.LOCKEDFLAG,classname,section_name,maxstrength,concat(s_teacher_master.firstname,\' \',s_teacher_master.lastname) as teachername,s_class_master.classname as classname,s_section_master.section_name as section_name,concat(s_teacher_master.firstname,\' \',s_teacher_master.lastname) as teachername FROM s_section_details INNER JOIN s_class_master ON (s_section_details.classid = s_class_master.id) INNER JOIN s_section_master ON (s_section_details.sectionid = s_section_master.id) LEFT OUTER JOIN s_teacher_master ON (s_section_details.classteacher = s_teacher_master.id) where s_section_details.classid=s_class_master.id and s_section_master.id=s_section_details.sectionid and s_section_details.schoolID=\'10009\' and s_section_details.academicyear = \'2011-2012\' AND (classid LIKE \'%%\' OR sectionid LIKE \'%%\' OR maxstrength LIKE \'%%\' OR classteacher LIKE \'%%\' ) ORDER BY s_section_details.ID LIMIT -30,15', '', '', 'Medium', 'Class Sections', 'sajja', '', '2010-05-02', '', '', 'Closed', '', '', '0000-00-00', '', 'Closed', 'sajja', '2010-07-03', '', '', '', 'completed', 1, '', '', '', ''),
(17, 17, '', '', 'In Class section page, while trying to add a new entry, if mandatroy fields are not specified, an error message is thrown. This is expected behavior. But that error message does not specify, for which fields data is missing.', '', '', 'Medium', 'Class Sections', 'sajja', '', '2010-05-02', '', '', 'Closed', '', '', '0000-00-00', '', 'Closed', 'sajja', '2010-07-03', '', '', '', 'completed', 1, '', '', '', ''),
