(112, 112, '', '', 'In "Pre-Admission Exam Marks" , search operation is failing with below error.\n\n"Column \'ID\' in where clause is ambiguous\nE-Point 5546: SELECT s_enroll_registration.ID,s_enroll_registration.LOCKEDFLAG,s_enroll_registration.ID,concat(firstname,\' \',middlename,\' \',lastname) AS Name,fathername,contactno,classname,marksobtained,status,concat(firstname,\' \',middlename,\' \',lastname) AS Name,s_class_master.classname as classname, concat(s_enroll_registration.posted,s_enroll_registration.status) as pstatus FROM s_enroll_registration,s_class_master where s_enroll_registration.classid=s_class_master.id and s_enroll_registration.academicyear = \'2009-2010\' and s_enroll_registration.schoolID=\'10009\' AND (ID LIKE \'%Jeldi%\' OR firstname LIKE \'%Jeldi%\' OR middlename LIKE \'%Jeldi%\' OR lastname LIKE \'%Jeldi%\' OR fathername LIKE \'%Jeldi%\' OR classid LIKE \'%Jeldi%\' OR feeamount LIKE \'%Jeldi%\' ) ORDER BY s_enroll_registration.ID LIMIT 0,15"', '', '', 'High', 'Admissions', 'sajja', '', '2010-08-15', '', 'Firefox - 3.6.6', 'Closed', '', '', '0000-00-00', '', 'Completed', '', '0000-00-00', '', '', '', '', 1, '', '', '', ''),
