(181, 181, '', '', 'Under "Admissions", one more page with name "Admission status" needs to be added. In this page, all "selected" students listed in "Pre-Admission Result" page are to be displayed. Columns to be displayed are as below.\n-------------------------------------------------\nEnroll ID\nStudent Name\nEnroll for Class\nAdmission Fee paid\nAdmission Status ( values - Admitted if all the fee paid. "Yet to pay fee", if fee not paid yet. )\n-------------------------------------------------\nthere should not be any "New" or "Delete" option. But, records should be editable.\nOnce Admission status for a student is changed to "Admitted", then Admission ID should be autogenerated as per below logic.\n\n-------------------------------------------------\nAdmission ID should be calculated with below logic.\nIt needs to start with last 2 digits of the year ( Ex:- If year is 2010, Adm ID should start with "10" ). Next, 2 digits should be class number ( for X-class, those digits will be "10". For VIII class, those digits will be "08". Next 3 digits should be autogenearted and should be next number to the last used number. Default ( when there are no students admitted ) last used number used should be "000". For the 1 st admitted student, last 3 digits of the Admission ID will be "001". So, for a student, who gets admitted in VIII class in 2010 will be "1008001". Reason for using last 3 digits is for the case, if all sections together, there can be more than or equal to 100 students and then, each one needs unique id, and that means, we need to have 3 digits.\n-------------------------------------------------', '', '', 'Low', 'Admissions', 'sajja', '', '2010-10-09', '', 'FireFox - 3.6.3', 'Open', '', '', '0000-00-00', '', '', 'adiseshu', '0000-00-00', 'We need to fix this', '', '', '', 1, '', '', '', ''),
